// Global Variables Start From Here

let graphValArray = [
  0, 15, 30, 45, 60, 75, 90, 105, 120, 135, 150, 175, 190, 205, 220, 235, 250,
  275, 290, 305,
];
const colors = ["#845EC2", "#D65DB1", "#FF6F91", "#FF9671", "#FFC75F"];
let formVal = {
  id: null,
  name: null,
  scale: null,
  feet: null,
  cm: null,
  gender: { name: null, id: null },
  color: null,
};
let previousList = [];
let personList = [];
let maxGraphHeght = 0;

// Global Variables Ends Here
//---------------------------------------------
window.onload = function () {
  createADiv(graphValArray);
  graphValArray = JSON.stringify(graphValArray);
  graphValArray = JSON.parse(graphValArray);

  colorDivGenrator();
};

// --------------------------------------------
// Add New Height From Methods
//---------------------------------------------

function onSelectValChg() {
  const scale = document.getElementById("scaleSelect").value;
  const feetDiv = document.getElementById("feetDiv");
  const cmDiv = document.getElementById("cmDiv");

  if (scale == 1) {
    cmDiv.classList.remove("d-none");
    cmDiv.classList.add("d-block");
    feetDiv.classList.add("d-none");
  } else {
    cmDiv.classList.add("d-none");
    feetDiv.classList.remove("d-none");
    feetDiv.classList.add("d-block");
  }
}

function chgGenderVal(val) {
  const male = document.getElementById("maleSec");
  const female = document.getElementById("feMaleSec");
  let newVal = {};
  if (val == 1) {
    newVal = { name: "Male", id: 1 };
    female.classList.remove("bg-primary");
    male.classList.add("bg-primary");
    male.classList.add("text-light");
    female.classList.remove("text-light");
  } else {
    newVal = { name: "Female", id: 2 };
    female.classList.add("bg-primary");
    female.classList.add("text-light");
    male.classList.remove("bg-primary");
    male.classList.remove("text-light");
  }

  formVal.gender = newVal;
}

function selectColor(clr) {
  formVal.color = clr;
  colors.map((color, index) => {
    console.log();
    if (color == clr) {
      const colorDiv = document.getElementById(`color${index + 1}`);
      colorDiv.classList.add("border-primary");
    }else{
          const colorDiv = document.getElementById(`color${index + 1}`);
          colorDiv.classList.remove("border-primary");
    }
  });
}

function getSeletedColor() {
  const inputVal = document.getElementById("input-color").value;
  if (inputVal) {
    formVal.color = inputVal;
  }
}

function getFormValues() {
  var name = document.getElementById("nameInput").value;
  var scale = document.getElementById("scaleSelect").value;
  var feet = document.getElementById("feetInput").value;
  var cm = document.getElementById("cmInput").value;

  if (!formVal.gender.id) {
    formVal.gender = { name: "Male", id: 1 };
  }
  formVal.name = name;
  formVal.scale = parseInt(scale);
  formVal.feet = parseFloat(scale == 2 ? feet : cmToFeet(cm));
  formVal.cm = parseFloat(scale == 1 ? cm : feetToCm(feet));
  formVal.color =
    formVal.color && formVal.color.length > 0
      ? formVal.color
      : generateRandomColor();
  formVal.id = generateAlphanumericId();
  if (formVal.cm > maxGraphHeght) {
    maxGraphHeght = formVal.cm;
  }
  // previousList.push(formVal)

  previousList = [...previousList, { ...formVal }];

  formVal = {
    name: null,
    scale: null,
    feet: null,
    cm: null,
    gender: { name: null, id: null },
    color: null,
  };
  handleSubmit(maxGraphHeght);
}

// --------------------------------------------
// Create Array of given value
//---------------------------------------------
function createArray(endValue) {
  endValue = endValue + 100;
  if (endValue <= 280) {
    return "Value should be greater than 280";
  }
  const arrayLength = 20;
  const startValue = 0;
  const step = (endValue - startValue) / (arrayLength - 1);
  const resultArray = [];
  for (let i = 0; i < arrayLength; i++) {
    resultArray.push(Math.round(startValue + i * step));
  }

  return resultArray;
}

// --------------------------------------------
// On Handel Submit
//---------------------------------------------
function handleSubmit(graphHeight) {
  const container = document.getElementById("container");
  const inputValue = graphHeight;
  if (inputValue > 280) {
    container.innerHTML = "";
    const result = createArray(parseFloat(inputValue));
    graphValArray = JSON.stringify(result);
    graphValArray = JSON.parse(graphValArray);
    createADiv(result);
  }

  personList = [];
  previousList.map((listData) => {
    addHeight(listData);
  });
}

//---------------------------------------------
// Create a div in UI
//---------------------------------------------

function createADiv(date) {
  const container = document.getElementById("container");
  console.log(graphValArray);

  let reversedArray = JSON.stringify(date);
  reversedArray = JSON.parse(reversedArray);

  reversedArray = reversedArray.reverse();
  // Loop over the array and create the HTML structure
  reversedArray.forEach((value, index) => {
    const div = document.createElement("div");
    div.classList.add("scale");
    div.style.height = "30px";
    div.style.position = "relative";
    div.style.width = "100%";
    div.style.borderBottom = "1px solid pink";
    const divRight = document.createElement("div");
    divRight.classList.add("position-absolute");
    divRight.style.minWidth = "70px";
    divRight.style.bottom = "-5px";

    divRight.textContent = ` ${value}`;
    div.appendChild(divRight);
    container.appendChild(div);
  });
}

//---------------------------------------------
// Create a div in UI
//---------------------------------------------

function addHeight(listData) {
  // const inputValue = document.getElementById("heightValue").value;
  const inputValue = listData.cm;
  let minVal = 0;
  let maxVal = 0;
  for (let i = 0; i < graphValArray.length; i++) {
    const element = graphValArray[i];
    if (inputValue <= element) {
      maxVal = element;
      minVal = graphValArray[i - 1];
      let topVal = inputValue - minVal;
      let bottomVal = maxVal - minVal;
      let valAfterDiv = topVal / bottomVal;
      finalVal = valAfterDiv * 100;
      let garphVal = calculateResult(finalVal);
      let barHeight = (i - 1) * 30;
      let personNo = personList.length + 1;
      personList.push({
        id: listData.id,
        name:
          listData.name && listData.name.length > 0
            ? listData.name
            : "Person" + personNo,
        graphHeight: (barHeight + garphVal).toFixed(2),
        inputVal: listData.cm,
        color: listData.color,
        gender: listData.gender,
        cmVal: listData.cm,
        feetVal: listData.feet,
        scale: listData.scale,
      });
      break;
    }
  }
  createGraph(personList);
}

function createGraph(data) {
  const divElement = document.getElementById("graph");
  while (divElement.firstChild) {
    divElement.removeChild(divElement.firstChild);
  }

  data.map((val, index) => {
    const div = document.createElement("div");
    div.id = "svgContainer" + index;
    divElement.appendChild(div);
    setSvgByHeightVal(val, index);
  });
}
function calculateResult(percentage) {
  let divideVal = percentage / 100;
  let multiVal = 30 * divideVal;
  return multiVal;
}

