// Remdom Color Genrator To Feet converter
// ------------------------------------------------------------------
function generateRandomColor() {
  // Generate three random values for red, green, and blue channels
  const red = Math.floor(Math.random() * 256);
  const green = Math.floor(Math.random() * 256);
  const blue = Math.floor(Math.random() * 256);

  // Convert the RGB values to hexadecimal format
  const redHex = red.toString(16).padStart(2, "0");
  const greenHex = green.toString(16).padStart(2, "0");
  const blueHex = blue.toString(16).padStart(2, "0");
  // Concatenate the hexadecimal values to form the color code
  const color = `#${redHex}${greenHex}${blueHex}`;
  return color;
}

function generateAlphanumericId() {
  // Define characters for alphanumeric ID
  const characters =
    "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
  const charactersLength = characters.length;
  // Get current time in milliseconds
  const currentTime = new Date().getTime().toString();
  // Generate 10 random alphanumeric characters
  let randomAlphanumeric = "";
  for (let i = 0; i < 10; i++) {
    randomAlphanumeric += characters.charAt(
      Math.floor(Math.random() * charactersLength)
    );
  }
  // Concatenate current time and random alphanumeric characters
  const alphanumericId = currentTime + randomAlphanumeric;
  return alphanumericId;
}
